import Sequelize from "sequelize";
import { sequelize } from "../database/database";

const Asiento = sequelize.define(
  "asiento",
  {
    asiento_id: {
      type: Sequelize.INTEGER,
      primaryKey: true
    },
    asiento_data: {
      type: Sequelize.JSONB
    },
    asiento_registrado: {
      type: Sequelize.DATE
    },
    asiento_modificado: {
